/* src/components/layout/ModuleLayout/ModuleLayout.js */
import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import DashBoard from '../../modules/DashBoard';
import EquipmentsPage from '../../modules/EquipmentsPage';
import TicketsPage from '../../modules/TicketsPage';

import './ModuleLayout.css';

function ModuleLayout() {
  const [activeModule, setActiveModule] = useState('dashboard');

  // Fonction pour rendre le module en fonction de l'état actif
  const renderModule = () => {
    switch (activeModule) {
      case 'DashBoard':
        return <Dashboard />;
      case 'EquipmentsPage':
        return <EquipmentsPage />;
      case 'TicketsPage':
        return <TicketsPage />;
      default:
        return <Dashboard />;
    }
  };

  return (
    <modulelayout className="modulelayout">
      <DashBoard />
    </modulelayout>
  );
}

export default ModuleLayout;
